import './HomePage.css';

function HomePage() {
  return (
    <div className="app">
      <header className="header">
        <div className="logo">
          <img src="/images/home-icon.png" alt="Logo" width="30" />
          WiseShare
        </div>
        <div className="search-bar-container">
          <input type="text" className="search-bar" placeholder="Search" />
          <button className="search-button">Search</button>
        </div>
        <div className="icons">
          <img src="/images/question-icon.png" alt="Help" />
          <img src="/images/profile-icon.png" alt="Profile" />
          <div className="language-selector">
            <img src="/images/globe-icon.png" alt="Language" />
            <span>English â–¼</span>
          </div>
        </div>
      </header>
      {/* Main Content */}
    </div>
  );
}

export default HomePage;
